a tua <strong>richiesta di credito</strong>. E in pochi giorni avrai la liquidit necessaria \r\n        per i tuoi progetti. Lintero processo  online, gratuito e senza impegno.</p>'),(1963,227,'_come_funziona_row_3_come_funziona_row_3_sottotitolo','field_635252264342c'),(1964,227,'come_funziona_row_3',''),(1965,227,'_come_funziona_row_3','field_6352521c98889'),(1966,227,'come_funziona_row_4_come_funziona_row_4_titolo','Realizza i tuoi progetti, <strong>PrestaKey</strong> ti d credito.'),(1967,227,'_come_funziona_row_4_come_funziona_row_4_titolo','field_635252203e574'),(1968,227,'come_funziona_row_4_come_funziona_row_4_sottotitolo','<p>La piattaforma si rivolge ad <a href=\"/sono-una-azienda/\">aziende, ditte individuali</a> e <a href=\"/sono-un-privato/\">privati</a>. In pochi minuti <strong>PrestaKey</strong> analizza la tua capacit finanziaria in modo esaustivo e ti suggerisce il prodotto pi adatto al tuo profilo. Lobiettivo  quello di <strong>ridurre al minimo il rischio di veder rifiutate le tue richieste di liquidit</strong> da parte di banche o istituti di credito.</p>\r\n                    <p>Lintero processo si svolge online, senza noiosi appuntamenti in filiale e senza dover attendere lincontro con il gestore bancario. <strong>In totale sicurezza, preservando la tua privacy</strong>.</p>'),(1969,227,'_come_funziona_row_4_come_funziona_row_4_sottotitolo','field_63525220420ed'),(1970,227,'come_funziona_row_4_come_funziona_row_4_titolo_2','Come funziona la <strong>procedura</strong>?'),(1971,227,'_come_funziona_row_4_come_funziona_row_4_titolo_2','field_6352522045d62'),(1972,227,'come_funziona_row_4_come_funziona_row_4_titolo_3','<strong>In qualsiasi momento</strong> potrai chiedere lintervento di un nostro operatore che, al telefono, ti guider nella procedura.'),(1973,227,'_come_funziona_row_4_come_funziona_row_4_titolo_3','field_6352522049802'),(1974,227,'come_funziona_row_4_come_funziona_row_4_titolo_asterisco','<strong>* Perch la piattaforma ha bisogno de