rocesso  online, gratuito e senza impegno.</p>'),(2039,229,'_come_funziona_row_3_come_funziona_row_3_sottotitolo','field_635252264342c'),(2040,229,'come_funziona_row_3',''),(2041,229,'_come_funziona_row_3','field_6352521c98889'),(2042,229,'come_funziona_row_4_come_funziona_row_4_titolo','Realizza i tuoi progetti, <strong>PrestaKey</strong> ti d credito.'),(2043,229,'_come_funziona_row_4_come_funziona_row_4_titolo','field_635252203e574'),(2044,229,'come_funziona_row_4_come_funziona_row_4_sottotitolo','<p>La piattaforma si rivolge ad <a href=\"/sono-una-azienda/\">aziende, ditte individuali</a> e <a href=\"/sono-un-privato/\">privati</a>. In pochi minuti <strong>PrestaKey</strong> analizza la tua capacit finanziaria in modo esaustivo e ti suggerisce il prodotto pi adatto al tuo profilo. Lobiettivo  quello di <strong>ridurre al minimo il rischio di veder rifiutate le tue richieste di liquidit</strong> da parte di banche o istituti di credito.</p>\r\n                    <p>Lintero processo si svolge online, senza noiosi appuntamenti in filiale e senza dover attendere lincontro con il gestore bancario. <strong>In totale sicurezza, preservando la tua privacy</strong>.</p>'),(2045,229,'_come_funziona_row_4_come_funziona_row_4_sottotitolo','field_63525220420ed'),(2046,229,'come_funziona_row_4_come_funziona_row_4_titolo_2','Come funziona la <strong>procedura</strong>?'),(2047,229,'_come_funziona_row_4_come_funziona_row_4_titolo_2','field_6352522045d62'),(2048,229,'come_funziona_row_4_come_funziona_row_4_titolo_3','<strong>In qualsiasi momento</strong> potrai chiedere lintervento di un nostro operatore che, al telefono, ti guider nella procedura.'),(2049,229,'_come_funziona_row_4_come_funziona_row_4_titolo_3','field_6352522049802'),(2050,229,'come_funziona_row_4_come_funziona_row_4_titolo_asterisco','<strong>* Perch la piattaforma ha bisogno degli estratti conto delle mie banche?</strong>'),(2051,229,'_come_funziona_row_4_come_funziona_row_4_titolo_asterisco','field_635252204