to che meglio si adatta al tuo profilo.\r\n<strong>Successivamente, se vorrai, ti proporr le migliori opzioni dei nostri partner per ottenere la liquidit richiesta</strong>. Potrai ottenere il tuo credito entro cinque giorni lavorativi (*).\r\n<p style=\"font-size: 10px\"><strong>(*) i tempi possono variare in funzione dei tempi di allineamento tra lIstituto Bancario erogante e lIstituto Bancario del richiedente.</strong></p>'),(3424,347,'_noi_row_2_noi_row_2_sottotitolo','field_6352628a2649b'),(3425,347,'noi_row_2',''),(3426,347,'_noi_row_2','field_6352628a26499'),(3427,347,'noi_row_3_noi_row_3_titolo','La missione di <strong>PrestaKey</strong>  lo sviluppo di un sistema di accesso al credito basato <strong>sulla giusta valutazione del merito di credito.</strong>\r\n\r\nAttraverso la tecnologia offriamo accesso a servizi bancari a a chi ha avuto difficolta a fruirne fino ad oggi. <strong>Una sorta di democratizzazione del credito.</strong>\r\n\r\nDa qui nasce il concetto del payoff <strong>\"Digitalizzare le decisioni\"</strong>, che mette insieme i due concetti fondanti di PrestaKey. Il primo  il <strong>digital</strong>, quindi il finanziamento da richiedere online, anche da mobile, in pochi click. Il secondo verte sul fatto che grazie alla tecnologia della piattaforma, in pochi minuti <strong>aziende e privati avranno l\'esito della richiesta di finanziamento, la giusta valutazione del merito di credito e, di conseguenza, la corretta liquidit.</strong>'),(3428,347,'_noi_row_3_noi_row_3_titolo','field_635263260b153'),(3429,347,'noi_row_3',''),(3430,347,'_noi_row_3','field_635263260b152'),(3431,347,'noi_row_4_noi_row_4_titolo','Il team di <strong>PrestaKey</strong>.'),(3432,347,'_noi_row_4_noi_row_4_titolo','field_6352636f17972'),(3433,347,'noi_row_4',''),(3434,347,'_noi_row_4','field_6352636f17971'),(3435,347,'noi_row_5_noi_row_5_titolo','Il team partner di <strong>PrestaKey</strong>.'),(3436,347,'_noi_row_5_noi_row_5_titolo','field_635263ad00647'),(3437,347,'noi