ivo  quello di <strong>ridurre al minimo il rischio di veder rifiutate le tue richieste di liquidit</strong> da parte di banche o istituti di credito.\r\n\r\nLintero processo si svolge online, senza noiosi appuntamenti in filiale e senza dover attendere lincontro con il gestore bancario. <strong>In totale sicurezza, preservando la tua privacy</strong>.'),(3856,356,'_come_funziona_row_4_come_funziona_row_4_sottotitolo','field_63525220420ed'),(3857,356,'come_funziona_row_4_come_funziona_row_4_titolo_2','Come funziona la <strong>procedura</strong>?'),(3858,356,'_come_funziona_row_4_come_funziona_row_4_titolo_2','field_6352522045d62'),(3859,356,'come_funziona_row_4_come_funziona_row_4_titolo_3','<strong>In qualsiasi momento</strong> potrai chiedere lintervento di un nostro operatore che, al telefono, ti guider nella procedura.'),(3860,356,'_come_funziona_row_4_come_funziona_row_4_titolo_3','field_6352522049802'),(3861,356,'come_funziona_row_4_come_funziona_row_4_titolo_asterisco','<strong>* Perch la piattaforma ha bisogno degli estratti conto delle mie banche?</strong>'),(3862,356,'_come_funziona_row_4_come_funziona_row_4_titolo_asterisco','field_635252204d29c'),(3863,356,'come_funziona_row_4_come_funziona_row_4_descrizione_asterisco','Per farti la miglior proposta possibile, Prestaky ha bisogno di alcune informazioni sui conti delle banche che utilizzi. Ti chieder, quindi, di condividere questi dettagli collegando i tuoi conti alla richiesta di finanziamento. Per farlo, ti baster accedereal tuo internet banking durante il processo, basteranno pochi click. Grazie allOpen Banking, questi passaggi si svolgeranno nella massima sicurezza e nel pieno rispetto della tua privacy. In pochi minuti otterrai una risposta alla tua richiesta.'),(3864,356,'_come_funziona_row_4_come_funziona_row_4_descrizione_asterisco','field_6352522050d3b'),(3865,356,'come_funziona_row_4',''),(3866,356,'_come_funziona_row_4','field_6352521c91374'),(3867,356,'come_funziona_row_5_come_funziona_row_5_t