o','field_6352628a2649a'),(4007,359,'noi_row_2_noi_row_2_sottotitolo','<strong>PrestaKey</strong>  una innovativa piattaforma italiana che si pone come obiettivo quello di orientare <a href=\"/sono-una-azienda/\">aziende, ditte individuali</a> e <a href=\"/sono-un-privato/\">privati</a>, a fare la <strong>giusta richiesta di prodotti finanziari</strong> in modo da ottenere liquidit rapidamente, riducendo il rischio di vedersi rifiutata la richiesta di credito.\r\n\r\n tutto molto semplice. Inserisci su <strong>PrestaKey</strong> i tuoi dati o della tua azienda. Grazie alla tecnologia avanzata, in <strong>pochi minuti la piattaforma analizza a fondo il tuo profilo finanziario</strong> e, in base alle tue caratteristiche, ti suggerisce il tipo di finanziamento che meglio si adatta al tuo profilo.\r\n<strong>Successivamente, se vorrai, ti proporr le migliori opzioni dei nostri partner per ottenere la liquidit richiesta</strong>. Potrai ottenere il tuo credito entro cinque giorni lavorativi (*).\r\n<p style=\"font-size: 10px\"><strong>(*) i tempi possono variare in funzione dei tempi di allineamento tra lIstituto Bancario erogante e lIstituto Bancario del richiedente.</strong></p>'),(4008,359,'_noi_row_2_noi_row_2_sottotitolo','field_6352628a2649b'),(4009,359,'noi_row_2',''),(4010,359,'_noi_row_2','field_6352628a26499'),(4011,359,'noi_row_3_noi_row_3_titolo','La missione di <strong>PrestaKey</strong>  lo sviluppo di un sistema di accesso al credito basato <strong>sulla giusta valutazione del merito di credito.</strong>\r\n\r\nAttraverso la tecnologia offriamo accesso a servizi bancari a a chi ha avuto difficolta a fruirne fino ad oggi. <strong>Una sorta di democratizzazione del credito.</strong>\r\n\r\nDa qui nasce il concetto del payoff <strong>\"Digitalizzare le decisioni\"</strong>, che mette insieme i due concetti fondanti di PrestaKey. Il primo  il <strong>digital</strong>, quindi il finanziamento da richiedere online, anche da mobile, in pochi click. Il secondo ve